INSERT INTO `biblio` VALUES (3,1,'Studi kelayakan proyek','Suad Husnan','Cetakan 1','979-8170-17-2',4,'s.a','xiv, 382 hlm.: ilus.; 23,5 cm','','001.4 SUA s','id',NULL,4,'001.4','Buku ini ditunjukan kepada siapa saja yang berminat tentang bagaimana melakukan studi kelayakan proyek: kerangka pemikirannya, prosesnya, teknik-teknik yang bisa dipergunakan, serta bagaimana menyusun laporannya. Studi kelayakan proyek tersebut intinya mempunyai tujuan untuk menilai apakah suatu proyek bisa memberikan manfaat bagi yang akan melaksanakan proyek tersebut. Meskipun sebagian besar pembicaraan dalam buku ini ditekankan pada manfaat proyek secara ekonomis, kita juga mengakui bahwa proyek bisa juga memberikan manfaat dari aspek yang lebih luas.','cover_studi-kelayakan-proyek-20260105143547.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2025-12-30 10:17:52','2026-01-05 14:35:47',1);
INSERT INTO `biblio` VALUES (4,1,'Belajar sendiri: mengenal internet jaringan informasi dunia','Daniel H. Purwadi','Cetakan 5','979-637-550-8',5,'1997','xv, 190 hlm.: ilus.; 20,7 cm','','004.678 DAN b','id',NULL,1,'004.678','Buku ini berisi penjelasan global hal-hal penting yang ada di Internet, mulai dari definisi Internet, statistik, sekuriti, organisasi-organisasi, standarisasi, registrasi dan segala layanan yang ada di Internet, serta cara bagaimana mengakses Internet','cover_belajar-sendiri-mengenal-internet-jaringan-informasi-dunia-20260105143612.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2025-12-30 11:51:22','2026-01-05 14:36:12',1);
INSERT INTO `biblio` VALUES (5,1,'Ilmu komunikasi: teori dan praktek','Onong Uchjana effendy','Cetakan 9','979-514-030-2',6,'1995','ix, 181 hlm.: 23,8 cm','','001.51 ONO i','id',NULL,2,'001.51','Buku Ilmu Komunikasi: Teori dan praktek ini tidak tidak hanya membahas komunikasi secara teoretis, tetapi juga menyertakan cara-cara menerapkannya dalam retorika, kepemimpinan, pembangunan, organisasi, pendidikan, hubungan masyarakat, jurnalistik, dan perang urat saraf. Karenanya buku ini tidak hanya berguna bagi para mahasiswa fakultas ilmu komunikasi, tetapi juga berguna bagi politikus, pemimpin, pengusaha, pendidik, kepala humas, wartawan, perwira, dan Anda, para komunikator yang senantiasa berupaya meningkatkan keterampilan berkomunikasi.','cover_ilmu-komunikasi-teori-dan-praktek-20260105143523.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2025-12-31 10:40:39','2026-01-05 14:35:23',1);
INSERT INTO `biblio` VALUES (6,1,'Dasar-dasar operations research','Pangestu Subagyo','Edisi 2, cetakan 9','979-503-173-2',7,'1992','viii, 308 hlm.: ilus.; 22,9 cm','','001.4 PAN d','id',NULL,4,'001.4','Buku ini merupakan bagian pertama, yang berisikan konsep-konsep dasar riset operasi dilengkapi dengan berbagai contoh persoalan yang sesuai. Tentunya bagian pertama tidak akan terpisah dari bagian kedua. Bagian kedua, merupakan buku tersendiri yang berisi berbagai kasus dan persoalan-persoalan riset operasi beserta pemecahannya.','cover_dasar-dasar-operations-research-20260105143201.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2025-12-31 11:41:34','2026-01-05 14:32:01',1);
INSERT INTO `biblio` VALUES (7,1,'Bahasa jurnalistik','Suhaimi','Cetakan 1','978-602-8606-74-5',8,'2009','x, 174 hlm.: 20,8 cm','','070.4 SUH b','id',NULL,5,'070.4','Bagaimana menulis berita atau laporan surat kabar, tabloit, majalah, radio, televisi dan media on line dalam kalimat yang mudah dipahami oleh khalayak atau diuraikan dalam buku yang berjudul \"Bahasa Jurnalistik\".','cover_bahasa-jurnalistik-20260105142209.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-05 08:39:09','2026-01-05 14:22:09',1);
INSERT INTO `biblio` VALUES (8,1,'Jurnalisme radio: teori paraktik','Santi Indra Astuti','Cetakan 1','9793782455',9,'2008','x, 174 hlm.: 24 cm','','070.4 SAN j','id',NULL,2,'070.4','Buku ini membahas segi-segi  yang terkait dengan dunia radio dari demensi jurnalisme.','cover_jurnalisme-radio-teori-paraktik-20260105132653.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-05 13:26:53','2026-01-05 13:26:53',1);
INSERT INTO `biblio` VALUES (9,1,'Jurnalistik televisi: menjadi reporter profesional','Deddy Iskandar Muda','Cetakan 2','979-692-239-8',6,'2005','viii, 235 hlm.: ilus.; 20,6 cm','','070.43 DED j','id',NULL,2,'070.43','Buku yang ada dalam genggaman anda ini tidak bermaksud menjembatani jurang besar kedua kutub tersebut. Tapi tidak banyak masyarakat yang tahu bagaimana acara-acara favorit anda itu bisa anda nikmati. Di sinilah pentingnya buku ini, khususnya anda yang ingin menekuni dunia reporter tv. Bagi komunitas televisi yang kini pertumbuhannya cukup pesat, sementara referensi untuk lebih mengembangkan lagi masih terbatas. Bagi para mahasiswa, khususnya yang mendalami ilmu komunikasi, jelas pertelevisian merupakan kajian utamanya','cover_jurnalistik-televisi-menjadi-reporter-profesional-20260105133054.jpg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-05 13:30:54','2026-01-07 08:09:00',1);
INSERT INTO `biblio` VALUES (10,1,'mengurai permasalahan jurnalisme','Ana Nandhya Abrar','Cetakan 1','979-416-291-4',10,'1995','123 hlm.; 19 cm','','071 ANA m','id',NULL,1,'071','Buku ini terdiri dari lima bagian, yaitu : (1) Pendahuluan yang membahas bagaimana target komersial pers sanggup mengharubirukan konsep jurnalisme; (2) Bagian I Permasalahan praktek jurnalisme di indonesi; (3) Bagian II Permasalahan yang dibawa jurnalisme di indonesia; (4) Bagian III permasalahan yang menyangkut kebutuhan jurnalisme di indonesia; dan (5) penutup','cover_mengurai-permasalahan-jurnalisme-20260105134101.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 13:41:01','2026-01-05 13:41:01',1);
INSERT INTO `biblio` VALUES (11,1,'Generasi Baru Wartawan & Insdustri Pers Indonesia','Suwidi Tono','Cetakan 1','',11,'2003','viii, 174 hlm.: ilus.; 21,5 cm','','070.4 SUW 9','id',NULL,3,'070.4','Buku ini dikelompokkan dalam tiga bagian. Bagian pertama merupakan kumpulan \"coret-coret\" penulis yang pernah dimuat di sejumlah surat kabar nasional dan presentasi di beberapa kalangan civitas academia. Bagian kedua merupakan pengalaman pribadi penulis sebagai praktisi pers yang pernah mengemban tanggung jawab untuk mrmimpin beberapa usaha penerbitan di daerah dan di jakarta. sebagai tambahan, pada bagian akhir ini buku ini penulis menyertakan contoh cara pembuatan proposal penerbitan untuk para profesional pers yang hendak mengajukan penawaran kepada investor atau lembaga keuangan','cover_generasi-baru-wartawan-insdustri-pers-indonesiahttp-192-168-1-10-8-20260105141908.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 13:58:35','2026-01-05 14:34:48',1);
INSERT INTO `biblio` VALUES (12,1,'Dsar-dasar penyiaran: sejarah, organisasi, oprasional, dan regulasi','Hidajanto Djamal','Cetakan 1','978-602--8730-57-0',12,'2011','xii, 360 hlm; 23 cm','','070.4 HID a','id',NULL,1,'070.4','Menghadirkan gambaran utuh berkaitan dengsn lstsr belakang perkembangan media pernyiaran','cover_dsar-dasar-penyiaran-sejarah-organisasi-oprasional-dan-regulasi-20260105140640.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 14:06:40','2026-01-07 08:12:46',1);
INSERT INTO `biblio` VALUES (13,1,'Pedoman untuk wartawan','Albert L. Hester','Edisi 2','',13,'1997','viii, 282 hlm.: 23 cm','','070.4 HES p','id',NULL,1,'070.4','Ditujukan khusus pada wartawan Dunia ketiga, buku ini membahas keadaan dan persoalan-persoalan khusus yang dihadapi wartawan Dunia Ketiga. Berbeda dengan wartawan Amerika dan Eropa, wartawan Dunia Ketiga menulis untuk dan mengenai negara atau bangsa yang sedang membangun sebagai negara negara atau bangsa yang berdaulat. Setiap hari ia berhadapan dengan keadaan yang terus-menerus berubah ini, wartawan Dunia Ketiga harus lebih peka pada apa yang terjadi dalam masyarakat atau negerinya.','cover_pedoman-untuk-wartawan-20260105140823.jpg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-05 14:08:23','2026-01-05 14:17:14',1);
INSERT INTO `biblio` VALUES (14,1,'Metode Penelitian Jurnalisme: pendekatan kualitatif','Rulli Nasrullah','Cetakan 1','978-602-7973-92-3',9,'2020','viii, 406 hlm.: ilus.; 24 cm','','070.4 RUL m','id',NULL,2,'070.4','Buku ini terbagi menjadi tiga bagian utama yang masing-masing berada dalam pembahasan yang khusus. Bagian pertama lebih pada menempatkan bagaimana penelitian media dipandang dalam aspek teori dan histroris. Bagian kedua lebih secara spesifik mengupas tentang media itu sendiri. Mulai dari teks, khalayak, institusi, hingga fenomena media baru dibahas dengan kombinasi teori dan isu-isu yang mungkin bisa dijadikan fokus penelitian. Dan bagian terakhir lebih menekankan pada sisi praktis dari penelitian kualitatif di bidang jurnalisme itu sendiri','cover_metode-penelitian-jurnalisme-pendekatan-kualitatif-20260105143736.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 14:21:26','2026-01-05 14:39:42',1);
INSERT INTO `biblio` VALUES (15,1,'Jurnalistik televisi: teknik memburu dan menulis berita','Arifin S. Harahap','Cetakan 2','979-683-793-5',NULL,'','viii, 117 hlm. :Ilus ;25 cm','','070.4 ARI s','id',NULL,1,'070.4','Buku ini layak dibaca para pemula yang ingin menggeluti dunia jurnalistik.','cover_jurnalistik-televisi-teknik-memburu-dan-menulis-berita-20260105143835.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 14:38:35','2026-01-07 08:11:44',1);
INSERT INTO `biblio` VALUES (16,1,'Jurnalistik Televisi: tentang dan sekitar siaran berita TVRI','J.B. Wahyudi','Cetakan 1','',14,'1984','xvi,215 hlm.: ilus.; 20,6 cm','','070.15 WAH j','id',NULL,2,'070.15','Buku ini akan memberikan informasi kepada khalayak pembaca tentang Jurnalistik Televisi dan penggunaannya di Indonesia karena kebijaksanaan pemerintah menetapkan pengelola tunggal pertelevisian di Indonesia adalah Televisi RI, maka isi buku ini memberikan jawaban \"mengapa\" Pusat Pemberitaan TVRI dan Pemberitaan Stasiun TVRI Daerah menyajikan bentuk-bentuk berita televisi seperti sekarang ini. Demikian pula \"bagaimana\" berita televisi dikelola oleh personal pemberitaan TVRI sampai penyajiaannya diuraikan secara lengkap dalam buku ini.','cover_jurnalistik-televisi-tentang-dan-sekitar-siaran-berita-tvri-20260105145758.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 14:54:57','2026-01-05 14:57:58',1);
INSERT INTO `biblio` VALUES (17,1,'Jurnalistik televisi: teori dan praktik','Askurifai Baksin','Cetakan 1','979378218-8',9,'2006','xii, 252 hlm. ; Ilus. ; 23,5 cm','','070.4 ASK j','id',NULL,2,'070.4','Buku ini menguraikan dua aspek yang menjadi kebutuhan pokok para calon jurnalis televisi (tv journalistik).','cover_jurnalistik-televisi-teori-dan-praktik-20260105145545.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 14:55:45','2026-01-07 08:12:13',1);
INSERT INTO `biblio` VALUES (18,1,'Jurnalistik televisi','Adi Badjuri','Edisi 1, cetakan 1','978-979-756-693-7',15,'2010','viii, 192 hlm.: 23 cm','','070.4 ADI j','id',NULL,4,'070.4','Salah satu program penting dalam siaran televisi adalah program berita (news programm). Program berita dikemas dalam 4 (empat) kali tayang; berita pagi, berita siang, berita sore dan berita malam. Berita-berita yang disiarkan televisi merupakan berita aktual bahkan lebih dari itu ada siaran berita yang langsung diwartakan dari tempat kejadian atau pada saat peristiwa itu terjadi. Di sinilah kelebihan media televisi. Karena itu diperlukan sumber daya manusia yang memiliki pengetahuan jurnalistik televisi, berdedikasi tinggi, dan memiliki ide-ide cemerlang.','cover_jurnalistik-televisi-20260105145814.jpg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-05 14:58:14','2026-01-05 14:58:14',1);
INSERT INTO `biblio` VALUES (19,1,'Komputer grafik: program grafik dengan resolusi biasa/teks','Rijanto tosin','Cetakan 1','',16,'s.a','ix, 186 hlm. : Ilus, ; 20,5 cm','','006.6 RUJ k','id',NULL,1,'006.6','Buku ini dirancang khusus untuk membahas topik komputer grafik secara tuntas dan sistematik dalam tiga tahapan.','cover_komputer-grafik-program-grafik-dengan-resolusi-biasa-teks-20260105151350.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-05 15:13:50','2026-01-07 08:11:05',1);
INSERT INTO `biblio` VALUES (20,1,'Akuntansi terpadu dengan DAC EASY ACCOUNTING','Daniel Setiawan','Cetakan 1','',5,'s.a','xiii, 206 hlm.: ilus.; 21 cm','','005.36 DAN a','id',NULL,1,'005.36','Buku ini ditulis untuk membantu siapa saja yang tertarik dan berminat untuk mempelajari komputer akuntansi. Buku ini bersifat \'TUTORIAL\' dimana didalamnya dibahas pengenalan DEA dalam kegiatan akuntansi sehari-hari. Setiap pembahasan disertai dengan latihan-latihan singkat yang akan membuat anda lebih memahami sistim dan cara kerja program akuntansi ini. Sedangkan pada buku kedua akan dibahas studi kasus nyata masalah akuntansi beserta analisa laporan keuangan yang dihasilkannya dengan memakai DAC-EASY ACCOUNTING','cover_akuntansi-terpadu-dengan-dac-easy-accounting-20260106141608.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-05 15:26:05','2026-01-06 14:16:08',1);
