INSERT INTO `biblio` VALUES (22,1,'metodologi penelitian sosial','Syamsir Salam','Cetakan 1','979-3869-39-9',8,'2006','viii, 145 hlm.: 20,6 cm','','001.42 SYAM m','id',NULL,6,'001.42','penulisan buku ajar \"Metodologi Penelitian Sosial\" ini sesungguhnya didasari atas adanya kebutuhan terhadap perlunya buku panduan yang sangat teknis mengkaji metodologi penelitian sosial sekaligus memuat tahapan-tahapan pelaksanaan penelitian sosial.','cover_metodologi-penelitian-sosial-20260106145842.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-06 14:58:42','2026-01-06 14:58:42',1);
INSERT INTO `biblio` VALUES (23,1,'Ilmu nahwu: tatabahasa arab','M. Sufyan','Cetakan 1','',18,'1985','','','149 MSU i','id',NULL,4,'149','Ilmu nahwu ialah salah satu gramatika bahasa arab yang sangat penting untuk dipelajari bagi orang yang ingin memahami bahasa arab','cover_ilmu-nahwu-tatabahasa-arab-20260107080718.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-06 15:03:32','2026-01-07 08:07:18',1);
INSERT INTO `biblio` VALUES (24,1,'Press Relations: kiat berhubungan dengan media massa','Aceng Abdullah','Cetakan 1','979-514-926-1',6,'2000','vii, 123 hlm.: 24 cm','','070. 4 ALE p','id',NULL,2,'070. 4','Frank Jeffkins, pakar komunikasi terkenal di inggris dan amerika, menyebut press relations sebagai upaya untuk membangun citra positif suatu organisasi. Membangun suatu citra yang baik membutuhkan  waktu lama dan biaya yang tidak sedikit.','cover_press-relations-kiat-berhubungan-dengan-media-massa-20260106151333.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-06 15:13:33','2026-01-06 15:13:33',1);
INSERT INTO `biblio` VALUES (25,1,'Pilar islam: bagi pluralisme moderen','IImam Sukardi','Cetakan 1','979-668-405-5',19,'2003','','','147 IMA p','id',NULL,7,'147','Agama merupakakan perspektif dalam menilai dan memandang sesuatu yang sarat dengan muatan moral sehingga identitas keagamaan sekaligus merupakan sebuah  perspektif yang dapat menentukan cara pandandang seseorang','cover_pilar-islam-bagi-pluralisme-moderen-20260107080641.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-06 15:24:18','2026-01-07 08:06:41',1);
INSERT INTO `biblio` VALUES (26,1,'Kritik Islam Terhadap Faham Materealisme','Murthada Muthahari','Cetakan 1','',20,'1992','v, 186 hlm.: 20,4 cm','','146.3 MAR k','id',NULL,8,'146.3','Dalam  bukunya kali ini beliau menyoroti dan mengkritik faham materealisme dari sudut pandang filsafat, sosiologi dan sesekali dari sudut pandang Qur\'ani. Dan seperti biasanya dalam karya inipun penguasaan beliau yang mendalam terhadap alur pemikiran dunia barat, semakin membuat tegar bobot dan karyanya ini, apalagi ditambah penguasaan akhli  dalam bidang keislaman membuat pandangan pandangannya semakin dalam tak tergoyahkan.','cover_kritik-islam-terhadap-faham-materealisme-20260107081114.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 08:11:14','2026-01-07 08:11:14',1);
INSERT INTO `biblio` VALUES (27,1,'Atomic habits: perubahan kecil yang memberikan hasil luar biasa','James Clear','Cetakan 49','978-602-063317-6',21,'2025','ix, 340 hlm.: ilus.; 23 cm','','155.25 CLE a','id',NULL,1,'155.25','Orang mengira ketika ingin mengubah hidup, Anda perlu memikirkan hal-hal besar. Namun, pakar kebiasaan terkenal kelas dunia James Clear menemukan cara lain. Ia tahu bahwa perubahan nyata berasal dari efek gabungan ratusan keputusan kecil dari melakukan dua push-up sehari, bangun lima menit lebih awal, sampai menahan sebentar hasrat untuk menelpon. Ia menyebut semua itu atomic habits.','cover_atomic-habits-perubahan-kecil-yang-memberikan-hasil-luar-biasa-20260107083249.png',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-07 08:32:49','2026-01-07 08:33:57',1);
INSERT INTO `biblio` VALUES (28,1,'Secret of positive thinking: temukan rahasia & keajaiban berfikir positif','Albert Kurniawan','Cetakan 1','978-602-95377-5-8',22,'2009','','','153.4 ALB s','id',NULL,1,'153.4','Buku ini menjelaskan dengan detil kisi-kisi kesuksesan melalui pintu positive thinking , atau berfikir positif','cover_secret-of-positive-thinking-temukan-rahasia-keajaiban-berfikir-posi-20260107083753.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 08:37:53','2026-01-07 08:37:53',1);
INSERT INTO `biblio` VALUES (29,1,'Metodologi Research','Sutrisno Hadi','Cetakan 16','',23,'1984','vii, 86 hlm.: 20.7 cm','','001.42 SUT m','id',NULL,4,'001.42','Bulu ini adalah buku tentang metodologi research. Metodologi Reseach memberikan kupasan - kupasan tentang logika, dalil-dalil, postulat-postulat atau proposisi- proposisi yang melatar belakangi setiap langkah dan proses yang lazim ditempuh dalam kegiatan reseach; memberikan alternatif-alternatif dan petunjuk-petunjuk dalam memilih alternatif-alternatif itu, dan mengkomparasikan unsur-unsur penting dalam rangkaian kegiatan reseach.','cover_metodologi-research-20260107083919.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 08:39:19','2026-01-07 08:39:19',1);
INSERT INTO `biblio` VALUES (30,1,'Langkah Jitu','Sam Deeps','Cetakan 1','',24,'1991','xviii, 290 hlm.: 20 cm','','153.2 SAM I','id',NULL,1,'153.2','langkah jitu memiliki langkah-langkah yang jitu bagi setiap tugas yang dihadapi manajer - menulis laporan, mengatasi konflik, mengatur waktu, mempekerjakan karyawan, dan lebih banyak lagi dalam 140 daftar pemeriksaan berisi petunjuk, ketentuan, teknik dan strategi yang sudah terbukti keampuhannya.','cover_langkah-jitu-20260107085507.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 08:55:07','2026-01-07 08:55:07',1);
INSERT INTO `biblio` VALUES (31,1,'Who am i?; personalitiy test kenali & upgrade dirimu','@psikologiID','Cetakan 5','979-083-078-5',25,'2013','','','','id',NULL,1,'NONE','Buku who am i? menyajikan tes kepribadian sederhana dan populer, berdasarkan pengetahuan ilmiah, serta pengetahuan pengembangan yang praktis dan langsung bisa di terapkan di kehidupan sehari-hari','cover_who-am-i-personalitiy-test-kenali-upgrade-dirimu-20260107085600.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 08:56:00','2026-01-07 08:56:00',1);
INSERT INTO `biblio` VALUES (32,1,'Duapuluh prinsip mengasuh anak','Logan Wright','Cetakan 1','',26,'1985','ix, 204 hlm.: ilus.; 20,7 cm','','155.14 WRI d','id',NULL,1,'155.14','Buku ini ditulis berdasarkan praktek dan pengalaman bertahun-tahun sebagai psikolog yang sehari-harinya bergumul dengan masalah-masalah membesarkan anak-anak di rumah, yang tidak selalu mudah! Orang tua harus dapet mengendalikan anak-anaknya sebelum mereka dapat mencintai dan mendorong perkembangnya.','cover_duapuluh-prinsip-mengasuh-anak-20260107091106.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-07 09:11:06','2026-01-07 09:11:06',1);
INSERT INTO `biblio` VALUES (33,1,'Bukan di negri dongeng: kisah nyata pejuang keadilan','Helvy Tiana Rosa','Cetakan 4','979 3279-88-x',27,'2003','x, 180 hlm,; 21 cm','','153.8 HEL b','id',NULL,2,'153.8','bersama menjadi perjuang keadilan','cover_bukan-di-negri-dongeng-kisah-nyata-pejuang-keadilan-20260107092115.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 09:21:15','2026-01-07 09:21:15',1);
INSERT INTO `biblio` VALUES (34,1,'Meningkatkan Daya Ingat Anda','Donald H. Weiss','Cetakan 1','',28,'1990','86 hlm.: 18, 5 cm','','153.1 WEI m','id',NULL,9,'153.1','buku ini akan membantu anda  menguji  betapa baik anda mengingat apa yang sudah dikatakan. Otak adalah gudang besar yang menampung apa saja yang sudah anda alami, entah anda menyadari pengalaman itu atau tidak. Namun, anda dapat meningkatkan kualitas dari apa yang anda ingat dengan menjadi lebih siaga terhadap kebutuhan anda sendiri dan kebutuhan apa yang dipenuhi oleh ingatan anda.','cover_meningkatkan-daya-ingat-anda-20260107094541.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 09:45:41','2026-01-07 09:45:41',1);
INSERT INTO `biblio` VALUES (35,1,'Mendidik anak: doronglah bakat anak','Tim Redaksi Mitra Utama','Cetakan 2','',24,'1994','188 hlm.: 20 cm','','155.4 TIM m','id',NULL,1,'155.4','Dewasa ini, bila kita melihat ibu-bapak muda mereka yang telah memperoleh pendidikan jauh lebih tinggi dari generasi orangtuanya dahulu maka ada satu hal yang membesarkan hati. Para orangtua muda ini membangun kehidupan rumahtangga yang jauh lebih baik dan terencana, dari pada yang pernah dialaminya dahulu. Dalam hal gizi, kesehatan, pakaian, dan pendidikan; mereka ingin memberikan yang terbaik bagi anak-anaknya.','cover_mendidik-anak-doronglah-bakat-anak-20260107095021.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-07 09:50:21','2026-01-07 09:50:21',1);
INSERT INTO `biblio` VALUES (36,1,'Menggali dan Mengembangkan Kekuatan Tersembunyi di Dalam Diri','James K.Van Fleet','Cetakan 2','979-8940-84-6',24,'1997','xxiii, 401 hlm.: 20 cm','','153.2 FLE m','id',NULL,1,'153.2','Buku ini menggali dan mengembangkan kekuatan tersembunyi di dalam diri akan membantu anda mengubah seluruh kehidupan anda. Dia akan menolong anda mengembangkan kemampuan anda untuk meraih suskses yang lebih besar dan menakjubkan ketimbang menerima hasil seadanya atau sekedarnya saja. Buku ini mengisahkan tentang hasil penemuan saya yang telah memberikan banyak sekali hal yang terbaik kepada saya dalam kehidupan ini.','cover_menggali-dan-mengembangkan-kekuatan-tersembunyi-di-dalam-diri-20260107095710.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 09:57:10','2026-01-07 09:57:10',1);
INSERT INTO `biblio` VALUES (37,1,'Sukses & Prestasi: Volume VI','Sigit Maryanto','Cetakan 1','',24,'s.a','ii, 116 hlm.: 20,6 cm','','150 SIG s','id',NULL,1,'150','Di dalam artikel utama volume kali ini kita akan belajar bagaimana membangun antusiasme. Di dalam volume ini juga kita akan belajar bagaimana men-jalani hidup yang bukan sekedar menggelinding. Bagaimana memberikan per-hatian dan pujian terhadap berbagai kebaikan kecil yang kita alami setiap hari.','cover_sukses-prestasi-volume-vi-20260108075006.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-07 10:00:18','2026-01-08 07:50:06',1);
INSERT INTO `biblio` VALUES (38,1,'Bicara itu ada seninya : rahasia komunikasi yang efektif','Oh Su Hyang','Cetakan 43','978-602-455-392-0',29,'2025','xiv, 238 hlm.: 20,8 cm','','302.22 HYA b','id',NULL,1,'302.22','Ketika komunikasi menjadi hal penting untuk bersaing, pakar komunikasi Oh Su Hyang mengeluarkan buku yang sangat berarti. Selain berisi tentang pengalaman peningkatan diri, buku ini juga memuat berbagai konten mengenai teknik komunikasi, persuasi, dan negoisasi.','cover_bicara-itu-ada-seninya-rahasia-komunikasi-yang-efektif-20260108080310.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:03:10','2026-01-08 08:03:10',1);
INSERT INTO `biblio` VALUES (39,1,'Cara efektif mendidik dan mendisiplinkan anak','Charles Schaefer','Cetakan 3','',24,'1992','216 hlm.; 20 cm','','155.4 SCH c','id',NULL,1,'155.4','Buku ini mengandung pedoman-pedoman yang bersifat praktis dan mudah diterapkan dalam meningkatkan hubungan baik antar orang tua dengan anak-anak','cover_cara-efektif-mendidik-dan-mendisiplinkan-anak-20260108080332.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:03:32','2026-01-08 08:04:39',1);
INSERT INTO `biblio` VALUES (40,1,'Blink: kemampuan berpikir tanpa berpikir','Malcolm Gladwell','Cetakan 30','978-602-03-8057-5',21,'2025','viii, 316 hlm.: ilus.; 20 cm','','155.25 GLA b','id',NULL,1,'155.25','Blink adalah buku mengenai dua detik pertama yang sangat menentukan ketika kita mengamati sesuatu dua detik yang akan memberikan pemahaman dalam sekejap mata, yang terbentuk berkat pilihan-pilihan yang muncul dari \"komputer internal\" kita, alias kemampuan bawah sadar. Kemampuan inilah yang oleh Malcolm Gladwell disebut \"kemampuan berpikir tanpa berpikir\", ketika keputusan sekejap bisa didapat dari informasi yang sedikit tapiakurat melalui snap judgment dan thin slicing.','cover_blink-kemampuan-berpikir-tanpa-berpikir-20260108081018.jpg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-08 08:10:18','2026-01-08 08:10:18',1);
INSERT INTO `biblio` VALUES (41,1,'Dilema Psikolog Muslim','Malik B. Badri','Cetakan 1','',30,'1986','viii, 88 hlm.: 19 cm','','150.92 MAL d','id',NULL,1,'150.92','Buku ini sekarang disajikan dalam bentuk yang lebih  disempurnakan. Sekali lagi Dr. Badri menunjuk pada kewajiban dan tanntangan yang dihadapi para psikolog dan psikiater muslim: Terciptanya konseptualisasi dan pengembangan pskilogi islam yang sebenarnya. Buku ini dibuat berdasarkan sebuah makalah yang berjudul psikolog muslim dalam liang biawak yang saya baca pada tahum 1975 dalam rapat tahunan keemapat perkumpulan ilmuwan sosial muslim (AMSS) Amerika dan Kanada.','cover_dilema-psikolog-muslim-20260108081511.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:15:11','2026-01-08 08:15:11',1);
INSERT INTO `biblio` VALUES (42,1,'The psychology of maney','Morgan Housel','Cetakan 10','978-623-8371-04-4',31,'2024','xxiii, 294 hlm.: 22 cm','','155.25 HOV t','id',NULL,10,'155.25','The psychology of maney adalah bacaan penting bagi siapa saya yang ingin membuat keputusan yang lebih bijak atau menjalani kehidupan yang lebih kaya','cover_the-psychology-of-maney-20260108082624.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:26:24','2026-01-08 08:26:24',1);
INSERT INTO `biblio` VALUES (43,1,'Psikologi Keluarga: dari keluarga sakinah hingga keluarga bangsa','Achmad Mubarok','Cetakan 1','979-9056-88-8',32,'2005','viii, 253 hlm.: 20,5 cm','','155.6 ACH  p','id',NULL,1,'155.6','ada kemungkinan buku ini mengandung bias subyektif, karena banyak rujukan pengalaman yang bersifat individual.','cover_psikologi-keluarga-dari-keluarga-sakinah-hingga-keluarga-bangsa-20260108083803.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:38:03','2026-01-08 08:38:03',1);
INSERT INTO `biblio` VALUES (44,1,'Rahasia sukses membangun kecerdasan emosi dan spiritual: SEQ emotional spiritual quotient','Ary Ginanjar Agustian','Cetakan 29','979-96271-0-9',17,'2006','iiv, 305 hlm.; ilus,; 23 cm','','153.9 ARY e','id',NULL,1,'153.9','Buku ESQ memberi pencerahan dan mudah dicerna dalam melakukan transformasi ke-Islaman dari Tekstual ke Kontekstual, dan dari sebuah ide (gagasan) menuju operasional. Ary telah menempatkan Islam secara adil dan proporsional dan menegakkan kembali Islam sebagai agama yang Rahmatan lil Alamin.','cover_rahasia-sukses-membangun-kecerdasan-emosi-dan-spiritual-seq-emotional-20260108084107.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:41:07','2026-01-08 08:41:07',1);
INSERT INTO `biblio` VALUES (45,1,'Mengubah dunia','Muhammad Zuhaili Sabudin','Cetakan 1','97899811839696',33,'2022','xxii, 106 hlm.: ilus.; 21 cm','','155.25 ZUH m','id',NULL,11,'155.25','Pendidikan adalah senjata paling mematikan di dunia karena dengan itu anda dapat mengubah dunia','cover_mengubah-dunia-20260108084730.jpeg',NULL,0,1,NULL,0,'',20,NULL,NULL,'2026-01-08 08:47:30','2026-01-08 08:47:30',1);
INSERT INTO `biblio` VALUES (46,1,'Mencari hidup bahagia','Syureich','Cetakan 1','',34,'1989','vi, 101 hlm.: 20,7 cm','','158 SYA m','id',NULL,5,'158','Bhagia menurut pandangan sebagian manusia ialah suatu kesenangan yang dicapai oleh setiap orang menurut kehendaknya masing-masing yang mendatangkan keadaan atau suatau perasaaan gembira, tenteram (lepad dari segala sesuatu yang menyusahkan). bahagia merupakan keinginan fitrah manusia','cover_mencari-hidup-bahagia-20260108085639.jpg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:56:39','2026-01-08 08:56:39',1);
INSERT INTO `biblio` VALUES (47,1,'Sybil: Kisah nyata seorang gadis dengan 16 kepribadian','Flora Rheta Schreiber','Cetakan 13','979-416-076-6',35,'2007','494. ; 21 cm','','157.7 SCH s','id',NULL,1,'157.7','Buku ini saya pandang sangat berharga untuk dibaca, terutama bagi para dokter, psikiater dan psikolog. Kasus Sybil yang terpe-cah dalam 16 kepribadian jelas merupakan kasus menarik. Dalam buku ini dapat dibaca betapa Dr. Wilbur - psikiater yang merawat Sybil membuktikan bahwa perpecahan kepribadian (split of personality) tidak selalu merupakan gejala schizophre-nia seperti anggapan yang umumnya berlaku di kalangan para dokter dan ahli jiwa.','cover_sybil-kisah-nyata-seorang-gadis-dengan-16-kepribadian-20260108085825.jpeg',NULL,0,1,NULL,0,'',NULL,NULL,NULL,'2026-01-08 08:58:25','2026-01-08 08:58:25',1);
