INSERT INTO `search_biblio` VALUES (3,'Studi kelayakan proyek','Cetakan 1','979-8170-17-2','Suad Husnan - Suwarsono','Proyek -- Manajemen','Text','UPP AMP YKPN','Yogyakarta','Indonesia','001.4','','','text','','My Library','s.a','Buku ini ditunjukan kepada siapa saja yang berminat tentang bagaimana melakukan studi kelayakan proyek: kerangka pemikirannya, prosesnya, teknik-teknik yang bisa dipergunakan, serta bagaimana menyusun laporannya. Studi kelayakan proyek tersebut intinya mempunyai tujuan untuk menilai apakah suatu proyek bisa memberikan manfaat bagi yang akan melaksanakan proyek tersebut. Meskipun sebagian besar pembicaraan dalam buku ini ditekankan pada manfaat proyek secara ekonomis, kita juga mengakui bahwa proyek bisa juga memberikan manfaat dari aspek yang lebih luas.',NULL,'B00003','Textbook','001.4 SUA s',0,1,NULL,'xiv, 382 hlm.: ilus.; 23,5 cm','cover_studi-kelayakan-proyek-20260105143547.jpeg','2025-12-30 10:17:52','2026-01-05 14:35:47');
INSERT INTO `search_biblio` VALUES (4,'Belajar sendiri: mengenal internet jaringan informasi dunia','Cetakan 5','979-637-550-8','Daniel H. Purwadi','Internet','Text','PT Elex Media Komputindo','Jakarta','Indonesia','004.678','','','text','','My Library','1997','Buku ini berisi penjelasan global hal-hal penting yang ada di Internet, mulai dari definisi Internet, statistik, sekuriti, organisasi-organisasi, standarisasi, registrasi dan segala layanan yang ada di Internet, serta cara bagaimana mengakses Internet',NULL,'B00004','Textbook','004.678 DAN b',0,1,NULL,'xv, 190 hlm.: ilus.; 20,7 cm','cover_belajar-sendiri-mengenal-internet-jaringan-informasi-dunia-20260105143612.jpeg','2025-12-30 11:51:22','2026-01-05 14:36:12');
INSERT INTO `search_biblio` VALUES (5,'Ilmu komunikasi: teori dan praktek','Cetakan 9','979-514-030-2','Onong Uchjana effendy - Tjun Surjaman','Komunikasi','Text','PT Remaja Rosdakarya','Bandung','Indonesia','001.51','','','text','','My Library','1995','Buku Ilmu Komunikasi: Teori dan praktek ini tidak tidak hanya membahas komunikasi secara teoretis, tetapi juga menyertakan cara-cara menerapkannya dalam retorika, kepemimpinan, pembangunan, organisasi, pendidikan, hubungan masyarakat, jurnalistik, dan perang urat saraf. Karenanya buku ini tidak hanya berguna bagi para mahasiswa fakultas ilmu komunikasi, tetapi juga berguna bagi politikus, pemimpin, pengusaha, pendidik, kepala humas, wartawan, perwira, dan Anda, para komunikator yang senantiasa berupaya meningkatkan keterampilan berkomunikasi.',NULL,'B00005','Textbook','001.51 ONO i',0,1,NULL,'ix, 181 hlm.: 23,8 cm','cover_ilmu-komunikasi-teori-dan-praktek-20260105143523.jpeg','2025-12-31 10:40:39','2026-01-05 14:35:23');
INSERT INTO `search_biblio` VALUES (6,'Dasar-dasar operations research','Edisi 2, cetakan 9','979-503-173-2','Pangestu Subagyo - Marwan Asri - T. Hani Handoko','Riset Operasi - Penelitian','Text','BPFE','Yogyakarta','Indonesia','001.4','','','text','','My Library','1992','Buku ini merupakan bagian pertama, yang berisikan konsep-konsep dasar riset operasi dilengkapi dengan berbagai contoh persoalan yang sesuai. Tentunya bagian pertama tidak akan terpisah dari bagian kedua. Bagian kedua, merupakan buku tersendiri yang berisi berbagai kasus dan persoalan-persoalan riset operasi beserta pemecahannya.',NULL,'B00006','Textbook','001.4 PAN d',0,1,NULL,'viii, 308 hlm.: ilus.; 22,9 cm','cover_dasar-dasar-operations-research-20260105143201.jpeg','2025-12-31 11:41:34','2026-01-05 14:32:01');
