INSERT INTO `search_biblio` VALUES (10,'mengurai permasalahan jurnalisme','Cetakan 1','979-416-291-4','Ana Nandhya Abrar','Jurnalisme - Indonesia','Text','Pustaka Sinar Harapan','Jakarta','Indonesia','071','','','','',NULL,'1995','Buku ini terdiri dari lima bagian, yaitu : (1) Pendahuluan yang membahas bagaimana target komersial pers sanggup mengharubirukan konsep jurnalisme; (2) Bagian I Permasalahan praktek jurnalisme di indonesi; (3) Bagian II Permasalahan yang dibawa jurnalisme di indonesia; (4) Bagian III permasalahan yang menyangkut kebutuhan jurnalisme di indonesia; dan (5) penutup',NULL,'B00010',NULL,'071 ANA m',0,1,NULL,'123 hlm.; 19 cm','cover_mengurai-permasalahan-jurnalisme-20260105134101.jpg','2026-01-05 13:41:01','2026-01-05 13:41:01');
