INSERT INTO `search_biblio` VALUES (13,'Pedoman untuk wartawan','Edisi 2','','Albert L. Hester - Wai Lan J. Toi - Abdullah Alamudi','Jurnalisme - Wartawan','Text','Yayasan Obor Indonesia','Jakarta','Indonesia','070.4','','','text','','My Library','1997','Ditujukan khusus pada wartawan Dunia ketiga, buku ini membahas keadaan dan persoalan-persoalan khusus yang dihadapi wartawan Dunia Ketiga. Berbeda dengan wartawan Amerika dan Eropa, wartawan Dunia Ketiga menulis untuk dan mengenai negara atau bangsa yang sedang membangun sebagai negara negara atau bangsa yang berdaulat. Setiap hari ia berhadapan dengan keadaan yang terus-menerus berubah ini, wartawan Dunia Ketiga harus lebih peka pada apa yang terjadi dalam masyarakat atau negerinya.',NULL,'B00014','Textbook','070.4 HES p',0,1,NULL,'viii, 282 hlm.: 23 cm','cover_pedoman-untuk-wartawan-20260105140823.jpg','2026-01-05 14:08:23','2026-01-05 14:17:14');
INSERT INTO `search_biblio` VALUES (11,'Generasi Baru Wartawan & Insdustri Pers Indonesia','Cetakan 1','','Suwidi Tono','Wartawan','Text','Vision 03','Cimanggis Depok','Indonesia','070.4','','','','',NULL,'2003','Buku ini dikelompokkan dalam tiga bagian. Bagian pertama merupakan kumpulan \"coret-coret\" penulis yang pernah dimuat di sejumlah surat kabar nasional dan presentasi di beberapa kalangan civitas academia. Bagian kedua merupakan pengalaman pribadi penulis sebagai praktisi pers yang pernah mengemban tanggung jawab untuk mrmimpin beberapa usaha penerbitan di daerah dan di jakarta. sebagai tambahan, pada bagian akhir ini buku ini penulis menyertakan contoh cara pembuatan proposal penerbitan untuk para profesional pers yang hendak mengajukan penawaran kepada investor atau lembaga keuangan',NULL,'B00018',NULL,'070.4 SUW 9',0,1,NULL,'viii, 174 hlm.: ilus.; 21,5 cm','cover_generasi-baru-wartawan-insdustri-pers-indonesiahttp-192-168-1-10-8-20260105141908.jpg','2026-01-05 13:58:35','2026-01-05 14:34:48');
INSERT INTO `search_biblio` VALUES (14,'Metode Penelitian Jurnalisme: pendekatan kualitatif','Cetakan 1','978-602-7973-92-3','Rulli Nasrullah','Penelitian - Metode','Text','Simbiosa Rekatama Media','Bandung','Indonesia','070.4','','','','',NULL,'2020','Buku ini terbagi menjadi tiga bagian utama yang masing-masing berada dalam pembahasan yang khusus. Bagian pertama lebih pada menempatkan bagaimana penelitian media dipandang dalam aspek teori dan histroris. Bagian kedua lebih secara spesifik mengupas tentang media itu sendiri. Mulai dari teks, khalayak, institusi, hingga fenomena media baru dibahas dengan kombinasi teori dan isu-isu yang mungkin bisa dijadikan fokus penelitian. Dan bagian terakhir lebih menekankan pada sisi praktis dari penelitian kualitatif di bidang jurnalisme itu sendiri',NULL,'B00016',NULL,'070.4 RUL m',0,1,NULL,'viii, 406 hlm.: ilus.; 24 cm','cover_metode-penelitian-jurnalisme-pendekatan-kualitatif-20260105143736.jpg','2026-01-05 14:21:26','2026-01-05 14:39:42');
