INSERT INTO `search_biblio` VALUES (18,'Jurnalistik televisi','Edisi 1, cetakan 1','978-979-756-693-7','Adi Badjuri','Televisi - Jurnalisme','Text','Graha llmu','Yogyakarta','Indonesia','070.4','','','text','',NULL,'2010','Salah satu program penting dalam siaran televisi adalah program berita (news programm). Program berita dikemas dalam 4 (empat) kali tayang; berita pagi, berita siang, berita sore dan berita malam. Berita-berita yang disiarkan televisi merupakan berita aktual bahkan lebih dari itu ada siaran berita yang langsung diwartakan dari tempat kejadian atau pada saat peristiwa itu terjadi. Di sinilah kelebihan media televisi. Karena itu diperlukan sumber daya manusia yang memiliki pengetahuan jurnalistik televisi, berdedikasi tinggi, dan memiliki ide-ide cemerlang.',NULL,'B00022',NULL,'070.4 ADI j',0,1,NULL,'viii, 192 hlm.: 23 cm','cover_jurnalistik-televisi-20260105145814.jpg','2026-01-05 14:58:14','2026-01-05 14:58:14');
