INSERT INTO `search_biblio` VALUES (26,'Kritik Islam Terhadap Faham Materealisme','Cetakan 1','','Murthada Muthahari','islam - Kritik','Text','Risalah masa','jakarta pusat','Indonesia','146.3','','','','',NULL,'1992','Dalam  bukunya kali ini beliau menyoroti dan mengkritik faham materealisme dari sudut pandang filsafat, sosiologi dan sesekali dari sudut pandang Qur\'ani. Dan seperti biasanya dalam karya inipun penguasaan beliau yang mendalam terhadap alur pemikiran dunia barat, semakin membuat tegar bobot dan karyanya ini, apalagi ditambah penguasaan akhli  dalam bidang keislaman membuat pandangan pandangannya semakin dalam tak tergoyahkan.',NULL,'B00034',NULL,'146.3 MAR k',0,1,NULL,'v, 186 hlm.: 20,4 cm','cover_kritik-islam-terhadap-faham-materealisme-20260107081114.jpg','2026-01-07 08:11:14','2026-01-07 08:11:14');
INSERT INTO `search_biblio` VALUES (27,'Atomic habits: perubahan kecil yang memberikan hasil luar biasa','Cetakan 49','978-602-063317-6','James Clear - Alex Tri Kantjono Widodo','Motivasi (Psikologi)','Text','Gramedia Pustaka Utama','Jakarta','Indonesia','155.25','','','text','','My Library','2025','Orang mengira ketika ingin mengubah hidup, Anda perlu memikirkan hal-hal besar. Namun, pakar kebiasaan terkenal kelas dunia James Clear menemukan cara lain. Ia tahu bahwa perubahan nyata berasal dari efek gabungan ratusan keputusan kecil dari melakukan dua push-up sehari, bangun lima menit lebih awal, sampai menahan sebentar hasrat untuk menelpon. Ia menyebut semua itu atomic habits.',NULL,'B00035','Textbook','155.25 CLE a',0,1,NULL,'ix, 340 hlm.: ilus.; 23 cm','cover_atomic-habits-perubahan-kecil-yang-memberikan-hasil-luar-biasa-20260107083249.png','2026-01-07 08:32:49','2026-01-07 08:33:57');
INSERT INTO `search_biblio` VALUES (28,'Secret of positive thinking: temukan rahasia & keajaiban berfikir positif','Cetakan 1','978-602-95377-5-8','Albert Kurniawan','Curah pendapat - Pikiran dan pemikiran','Text','Abdika press','Jakarta','Indonesia','153.4','','','','',NULL,'2009','Buku ini menjelaskan dengan detil kisi-kisi kesuksesan melalui pintu positive thinking , atau berfikir positif',NULL,'B00036',NULL,'153.4 ALB s',0,1,NULL,'','cover_secret-of-positive-thinking-temukan-rahasia-keajaiban-berfikir-posi-20260107083753.jpeg','2026-01-07 08:37:53','2026-01-07 08:37:53');
INSERT INTO `search_biblio` VALUES (29,'Metodologi Research','Cetakan 16','','Sutrisno Hadi','Penelitian - Metode','Text','Universitas Gajah Mada','Yogyakarta','Indonesia','001.42','','','','',NULL,'1984','Bulu ini adalah buku tentang metodologi research. Metodologi Reseach memberikan kupasan - kupasan tentang logika, dalil-dalil, postulat-postulat atau proposisi- proposisi yang melatar belakangi setiap langkah dan proses yang lazim ditempuh dalam kegiatan reseach; memberikan alternatif-alternatif dan petunjuk-petunjuk dalam memilih alternatif-alternatif itu, dan mengkomparasikan unsur-unsur penting dalam rangkaian kegiatan reseach.',NULL,'B00037',NULL,'001.42 SUT m',0,1,NULL,'vii, 86 hlm.: 20.7 cm','cover_metodologi-research-20260107083919.jpg','2026-01-07 08:39:19','2026-01-07 08:39:19');
INSERT INTO `search_biblio` VALUES (30,'Langkah Jitu','Cetakan 1','','Sam Deeps - Lyle Sussman','langkah - jitu','Text','Mitra Utama','Jakarta','Indonesia','153.2','','','','',NULL,'1991','langkah jitu memiliki langkah-langkah yang jitu bagi setiap tugas yang dihadapi manajer - menulis laporan, mengatasi konflik, mengatur waktu, mempekerjakan karyawan, dan lebih banyak lagi dalam 140 daftar pemeriksaan berisi petunjuk, ketentuan, teknik dan strategi yang sudah terbukti keampuhannya.',NULL,'B00038',NULL,'153.2 SAM I',0,1,NULL,'xviii, 290 hlm.: 20 cm','cover_langkah-jitu-20260107085507.jpg','2026-01-07 08:55:07','2026-01-07 08:55:07');
INSERT INTO `search_biblio` VALUES (31,'Who am i?; personalitiy test kenali & upgrade dirimu','Cetakan 5','979-083-078-5','@psikologiID','Psikologi -- Penelitian - Psikologi','Text','Tangga Pusaka','Jakarta','Indonesia','NONE','','','','',NULL,'2013','Buku who am i? menyajikan tes kepribadian sederhana dan populer, berdasarkan pengetahuan ilmiah, serta pengetahuan pengembangan yang praktis dan langsung bisa di terapkan di kehidupan sehari-hari',NULL,'B00039',NULL,'',0,1,NULL,'','cover_who-am-i-personalitiy-test-kenali-upgrade-dirimu-20260107085600.jpeg','2026-01-07 08:56:00','2026-01-07 08:56:00');
INSERT INTO `search_biblio` VALUES (32,'Duapuluh prinsip mengasuh anak','Cetakan 1','','Logan Wright - Rafael H','Psikologi anak - Pendidikan','Text','Mega Media','Jakarta','Indonesia','155.14','','','text','',NULL,'1985','Buku ini ditulis berdasarkan praktek dan pengalaman bertahun-tahun sebagai psikolog yang sehari-harinya bergumul dengan masalah-masalah membesarkan anak-anak di rumah, yang tidak selalu mudah! Orang tua harus dapet mengendalikan anak-anaknya sebelum mereka dapat mencintai dan mendorong perkembangnya.',NULL,'B00040',NULL,'155.14 WRI d',0,1,NULL,'ix, 204 hlm.: ilus.; 20,7 cm','cover_duapuluh-prinsip-mengasuh-anak-20260107091106.jpeg','2026-01-07 09:11:06','2026-01-07 09:11:06');
INSERT INTO `search_biblio` VALUES (33,'Bukan di negri dongeng: kisah nyata pejuang keadilan','Cetakan 4','979 3279-88-x','Helvy Tiana Rosa - Izzatul Jannah','Sosiologi pendidikan','Text','syaamil Cipta Media','Bandung','Indonesia','153.8','','','','',NULL,'2003','bersama menjadi perjuang keadilan',NULL,'B00041',NULL,'153.8 HEL b',0,1,NULL,'x, 180 hlm,; 21 cm','cover_bukan-di-negri-dongeng-kisah-nyata-pejuang-keadilan-20260107092115.jpeg','2026-01-07 09:21:15','2026-01-07 09:21:15');
INSERT INTO `search_biblio` VALUES (34,'Meningkatkan Daya Ingat Anda','Cetakan 1','','Donald H. Weiss','Ingatan','Text','Binarupa Aksara','Jakarta Barat','Indonesia','153.1','','','','',NULL,'1990','buku ini akan membantu anda  menguji  betapa baik anda mengingat apa yang sudah dikatakan. Otak adalah gudang besar yang menampung apa saja yang sudah anda alami, entah anda menyadari pengalaman itu atau tidak. Namun, anda dapat meningkatkan kualitas dari apa yang anda ingat dengan menjadi lebih siaga terhadap kebutuhan anda sendiri dan kebutuhan apa yang dipenuhi oleh ingatan anda.',NULL,'B00042',NULL,'153.1 WEI m',0,1,NULL,'86 hlm.: 18, 5 cm','cover_meningkatkan-daya-ingat-anda-20260107094541.jpg','2026-01-07 09:45:41','2026-01-07 09:45:41');
INSERT INTO `search_biblio` VALUES (35,'Mendidik anak: doronglah bakat anak','Cetakan 2','','Tim Redaksi Mitra Utama','Psikologi anak','Text','Mitra Utama','Jakarta','Indonesia','155.4','','','text','',NULL,'1994','Dewasa ini, bila kita melihat ibu-bapak muda mereka yang telah memperoleh pendidikan jauh lebih tinggi dari generasi orangtuanya dahulu maka ada satu hal yang membesarkan hati. Para orangtua muda ini membangun kehidupan rumahtangga yang jauh lebih baik dan terencana, dari pada yang pernah dialaminya dahulu. Dalam hal gizi, kesehatan, pakaian, dan pendidikan; mereka ingin memberikan yang terbaik bagi anak-anaknya.',NULL,'B00043',NULL,'155.4 TIM m',0,1,NULL,'188 hlm.: 20 cm','cover_mendidik-anak-doronglah-bakat-anak-20260107095021.jpeg','2026-01-07 09:50:21','2026-01-07 09:50:21');
INSERT INTO `search_biblio` VALUES (36,'Menggali dan Mengembangkan Kekuatan Tersembunyi di Dalam Diri','Cetakan 2','979-8940-84-6','James K.Van Fleet','ide - Inspirasi','Text','Mitra Utama','Jakarta','Indonesia','153.2','','','','',NULL,'1997','Buku ini menggali dan mengembangkan kekuatan tersembunyi di dalam diri akan membantu anda mengubah seluruh kehidupan anda. Dia akan menolong anda mengembangkan kemampuan anda untuk meraih suskses yang lebih besar dan menakjubkan ketimbang menerima hasil seadanya atau sekedarnya saja. Buku ini mengisahkan tentang hasil penemuan saya yang telah memberikan banyak sekali hal yang terbaik kepada saya dalam kehidupan ini.',NULL,'B00044',NULL,'153.2 FLE m',0,1,NULL,'xxiii, 401 hlm.: 20 cm','cover_menggali-dan-mengembangkan-kekuatan-tersembunyi-di-dalam-diri-20260107095710.jpg','2026-01-07 09:57:10','2026-01-07 09:57:10');
INSERT INTO `search_biblio` VALUES (37,'Sukses & Prestasi: Volume VI','Cetakan 1','','Sigit Maryanto','Psikologi','Text','Mitra Utama','Jakarta','Indonesia','150','','','','',NULL,'s.a','Di dalam artikel utama volume kali ini kita akan belajar bagaimana membangun antusiasme. Di dalam volume ini juga kita akan belajar bagaimana men-jalani hidup yang bukan sekedar menggelinding. Bagaimana memberikan per-hatian dan pujian terhadap berbagai kebaikan kecil yang kita alami setiap hari.',NULL,'B00045',NULL,'150 SIG s',0,1,NULL,'ii, 116 hlm.: 20,6 cm','cover_sukses-prestasi-volume-vi-20260108075006.jpg','2026-01-07 10:00:18','2026-01-08 07:50:06');
INSERT INTO `search_biblio` VALUES (38,'Bicara itu ada seninya : rahasia komunikasi yang efektif','Cetakan 43','978-602-455-392-0','Oh Su Hyang','Komunikasi - Komunikasi dalam budaya','Text','Bhuana Ilmu Populer','Jakarta','Indonesia','302.22','','','','',NULL,'2025','Ketika komunikasi menjadi hal penting untuk bersaing, pakar komunikasi Oh Su Hyang mengeluarkan buku yang sangat berarti. Selain berisi tentang pengalaman peningkatan diri, buku ini juga memuat berbagai konten mengenai teknik komunikasi, persuasi, dan negoisasi.',NULL,'B00046 - B00047',NULL,'302.22 HYA b',0,1,NULL,'xiv, 238 hlm.: 20,8 cm','cover_bicara-itu-ada-seninya-rahasia-komunikasi-yang-efektif-20260108080310.jpg','2026-01-08 08:03:10','2026-01-08 08:03:10');
INSERT INTO `search_biblio` VALUES (39,'Cara efektif mendidik dan mendisiplinkan anak','Cetakan 3','','Charles Schaefer','Pendidikan dasar','Text','Mitra Utama','Jakarta','Indonesia','155.4','','','','',NULL,'1992','Buku ini mengandung pedoman-pedoman yang bersifat praktis dan mudah diterapkan dalam meningkatkan hubungan baik antar orang tua dengan anak-anak',NULL,'B00048',NULL,'155.4 SCH c',0,1,NULL,'216 hlm.; 20 cm','cover_cara-efektif-mendidik-dan-mendisiplinkan-anak-20260108080332.jpeg','2026-01-08 08:03:32','2026-01-08 08:04:39');
INSERT INTO `search_biblio` VALUES (40,'Blink: kemampuan berpikir tanpa berpikir','Cetakan 30','978-602-03-8057-5','Malcolm Gladwell - Alex Tri Kantjono Widodo','Pikiran dan pemikiran','Text','Gramedia Pustaka Utama','Jakarta','Indonesia','155.25','','','text','',NULL,'2025','Blink adalah buku mengenai dua detik pertama yang sangat menentukan ketika kita mengamati sesuatu dua detik yang akan memberikan pemahaman dalam sekejap mata, yang terbentuk berkat pilihan-pilihan yang muncul dari \"komputer internal\" kita, alias kemampuan bawah sadar. Kemampuan inilah yang oleh Malcolm Gladwell disebut \"kemampuan berpikir tanpa berpikir\", ketika keputusan sekejap bisa didapat dari informasi yang sedikit tapiakurat melalui snap judgment dan thin slicing.',NULL,'B00049 - B00050',NULL,'155.25 GLA b',0,1,NULL,'viii, 316 hlm.: ilus.; 20 cm','cover_blink-kemampuan-berpikir-tanpa-berpikir-20260108081018.jpg','2026-01-08 08:10:18','2026-01-08 08:10:18');
INSERT INTO `search_biblio` VALUES (41,'Dilema Psikolog Muslim','Cetakan 1','','Malik B. Badri','Psikolog','Text','Pustaka firdaus','Jakarta','Indonesia','150.92','','','','',NULL,'1986','Buku ini sekarang disajikan dalam bentuk yang lebih  disempurnakan. Sekali lagi Dr. Badri menunjuk pada kewajiban dan tanntangan yang dihadapi para psikolog dan psikiater muslim: Terciptanya konseptualisasi dan pengembangan pskilogi islam yang sebenarnya. Buku ini dibuat berdasarkan sebuah makalah yang berjudul psikolog muslim dalam liang biawak yang saya baca pada tahum 1975 dalam rapat tahunan keemapat perkumpulan ilmuwan sosial muslim (AMSS) Amerika dan Kanada.',NULL,'B00051',NULL,'150.92 MAL d',0,1,NULL,'viii, 88 hlm.: 19 cm','cover_dilema-psikolog-muslim-20260108081511.jpg','2026-01-08 08:15:11','2026-01-08 08:15:11');
INSERT INTO `search_biblio` VALUES (42,'The psychology of maney','Cetakan 10','978-623-8371-04-4','Morgan Housel - Lucia Aryani - Zia Ansshor','Psikologi','Text','Bentara Aksara Cahaya','Tanggerag','Indonesia','155.25','','','','',NULL,'2024','The psychology of maney adalah bacaan penting bagi siapa saya yang ingin membuat keputusan yang lebih bijak atau menjalani kehidupan yang lebih kaya',NULL,'B00052',NULL,'155.25 HOV t',0,1,NULL,'xxiii, 294 hlm.: 22 cm','cover_the-psychology-of-maney-20260108082624.jpeg','2026-01-08 08:26:24','2026-01-08 08:26:24');
INSERT INTO `search_biblio` VALUES (43,'Psikologi Keluarga: dari keluarga sakinah hingga keluarga bangsa','Cetakan 1','979-9056-88-8','Achmad Mubarok','Psikologi Dewasa','Text','the internasional institute of islamic thougt (IIIT) Indonesia dan Penerbit PT Bina rena  pariwara','Jakarta','Indonesia','155.6','','','','',NULL,'2005','ada kemungkinan buku ini mengandung bias subyektif, karena banyak rujukan pengalaman yang bersifat individual.',NULL,'B00053',NULL,'155.6 ACH  p',0,1,NULL,'viii, 253 hlm.: 20,5 cm','cover_psikologi-keluarga-dari-keluarga-sakinah-hingga-keluarga-bangsa-20260108083803.jpg','2026-01-08 08:38:03','2026-01-08 08:38:03');
INSERT INTO `search_biblio` VALUES (44,'Rahasia sukses membangun kecerdasan emosi dan spiritual: SEQ emotional spiritual quotient','Cetakan 29','979-96271-0-9','Ary Ginanjar Agustian','Kematangan emosional','Text','Arga','Jakarta','Indonesia','153.9','','','','',NULL,'2006','Buku ESQ memberi pencerahan dan mudah dicerna dalam melakukan transformasi ke-Islaman dari Tekstual ke Kontekstual, dan dari sebuah ide (gagasan) menuju operasional. Ary telah menempatkan Islam secara adil dan proporsional dan menegakkan kembali Islam sebagai agama yang Rahmatan lil Alamin.',NULL,'B00054',NULL,'153.9 ARY e',0,1,NULL,'iiv, 305 hlm.; ilus,; 23 cm','cover_rahasia-sukses-membangun-kecerdasan-emosi-dan-spiritual-seq-emotional-20260108084107.jpeg','2026-01-08 08:41:07','2026-01-08 08:41:07');
INSERT INTO `search_biblio` VALUES (45,'Mengubah dunia','Cetakan 1','97899811839696','Muhammad Zuhaili Sabudin','Kepribadian','Text','MZ Zuhaili Services & Quran Centre','Singapore','Indonesia','155.25','','','text','',NULL,'2022','Pendidikan adalah senjata paling mematikan di dunia karena dengan itu anda dapat mengubah dunia',NULL,'B00055',NULL,'155.25 ZUH m',0,1,NULL,'xxii, 106 hlm.: ilus.; 21 cm','cover_mengubah-dunia-20260108084730.jpeg','2026-01-08 08:47:30','2026-01-08 08:47:30');
INSERT INTO `search_biblio` VALUES (46,'Mencari hidup bahagia','Cetakan 1','','Syureich','kebahagiaan','Text','pesantren terpadu al-awwabin','Jakarta Selatan','Indonesia','158','','','','',NULL,'1989','Bhagia menurut pandangan sebagian manusia ialah suatu kesenangan yang dicapai oleh setiap orang menurut kehendaknya masing-masing yang mendatangkan keadaan atau suatau perasaaan gembira, tenteram (lepad dari segala sesuatu yang menyusahkan). bahagia merupakan keinginan fitrah manusia',NULL,'B00056',NULL,'158 SYA m',0,1,NULL,'vi, 101 hlm.: 20,7 cm','cover_mencari-hidup-bahagia-20260108085639.jpg','2026-01-08 08:56:39','2026-01-08 08:56:39');
INSERT INTO `search_biblio` VALUES (47,'Sybil: Kisah nyata seorang gadis dengan 16 kepribadian','Cetakan 13','979-416-076-6','Flora Rheta Schreiber','Kepribadian - kelainan - Aspek psikologi','Text','Pustaa Sinar Harapan','Jakarta','Indonesia','157.7','','','','',NULL,'2007','Buku ini saya pandang sangat berharga untuk dibaca, terutama bagi para dokter, psikiater dan psikolog. Kasus Sybil yang terpe-cah dalam 16 kepribadian jelas merupakan kasus menarik. Dalam buku ini dapat dibaca betapa Dr. Wilbur - psikiater yang merawat Sybil membuktikan bahwa perpecahan kepribadian (split of personality) tidak selalu merupakan gejala schizophre-nia seperti anggapan yang umumnya berlaku di kalangan para dokter dan ahli jiwa.',NULL,'B00057',NULL,'157.7 SCH s',0,1,NULL,'494. ; 21 cm','cover_sybil-kisah-nyata-seorang-gadis-dengan-16-kepribadian-20260108085825.jpeg','2026-01-08 08:58:25','2026-01-08 08:58:25');
